        key: "updateRowGroupMetaData",
        value: function updateRowGroupMetaData() {
          debugger;
          this.rowGroupMetadata = {};

          if (this.podetailsList) {
            var count = 0;

            for (var i = 0; i < this.podetailsList.length; i++) {
              var rowData = this.podetailsList[i];
              var material = rowData.material;

              if (i == 0) {
                this.rowGroupMetadata[material] = {
                  index: 0,
                  size: 1
                };
                count = count + 1;
                this.podetailsList[i].serialno = count;
              } else {
                var previousRowData = this.podetailsList[i - 1];
                var previousRowGroup = previousRowData.material;
                if (material === previousRowGroup) this.rowGroupMetadata[material].size++;else {
                  this.rowGroupMetadata[material] = {
                    index: i,
                    size: 1
                  };
                  count = count + 1;
                  this.podetailsList[i].serialno = count;
                }
              }
            }
          }
        }
